import * as React from "react";
import PropTypes from "prop-types";
import Box from "@mui/material/Box";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableFooter from "@mui/material/TableFooter";
import TablePagination from "@mui/material/TablePagination";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import IconButton from "@mui/material/IconButton";
import TableHead from "@mui/material/TableHead";

function TablePaginationActions(props) {
  const { count, page, rowsPerPage, onPageChange } = props;

  const handleBackButtonClick = (event) => {
    onPageChange(event, page - 1);
  };

  const handleNextButtonClick = (event) => {
    onPageChange(event, page + 1);
  };

  return (
    <Box sx={{ flexShrink: 0, ml: 2.5 }}>
      <IconButton
        onClick={handleBackButtonClick}
        disabled={page === 0}
        aria-label="previous page"
      ></IconButton>
      <IconButton
        onClick={handleNextButtonClick}
        disabled={page >= Math.ceil(count / rowsPerPage) - 1}
        aria-label="next page"
      ></IconButton>
    </Box>
  );
}

TablePaginationActions.propTypes = {
  count: PropTypes.number.isRequired,
  onPageChange: PropTypes.func.isRequired,
  page: PropTypes.number.isRequired,
  rowsPerPage: PropTypes.number.isRequired,
};

function createData(dep, ret, depID, depName, retID, retName, dist, dur) {
  return { dep, ret, depID, depName, retID, retName, dist, dur };
}

const rows = [
  createData(
    "21-02-2020 00:01",
    "21-02-2020 00:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "120",
    "500"
  ),
  createData(
    "22-02-2020 00:01",
    "22-02-2020 00:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "122",
    "502"
  ),
  createData(
    "22-02-2020 00:01",
    "23-02-2020 10:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "124",
    "504"
  ),
  createData(
    "22-02-2020 00:01",
    "23-02-2020 10:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "124",
    "504"
  ),
  createData(
    "22-02-2020 00:01",
    "23-02-2020 10:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "124",
    "504"
  ),
  createData(
    "22-02-2020 00:01",
    "23-02-2020 10:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "124",
    "504"
  ),
  createData(
    "22-02-2020 00:01",
    "23-02-2020 10:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "124",
    "504"
  ),
  createData(
    "22-02-2020 00:01",
    "23-02-2020 10:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "124",
    "504"
  ),
  createData(
    "22-02-2020 00:01",
    "23-02-2020 10:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "124",
    "504"
  ),
  createData(
    "22-02-2020 00:01",
    "23-02-2020 10:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "124",
    "504"
  ),
  createData(
    "22-02-2020 00:01",
    "23-02-2020 10:02",
    "1",
    "Lahto Station",
    "2",
    "Paluu Station",
    "124",
    "504"
  ),
];

export default function CustomPaginationActionsTable() {
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);

  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 500 }} aria-label="custom pagination table">
        <TableHead>
          <TableRow>
            <TableCell>Departure</TableCell>
            <TableCell>Return</TableCell>
            <TableCell>Departure Station ID</TableCell>
            <TableCell>Departure Station Name</TableCell>
            <TableCell>Return Station ID</TableCell>
            <TableCell>Return Station Name</TableCell>
            <TableCell>Distance</TableCell>
            <TableCell>Duration</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {(rowsPerPage > 0
            ? rows.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
            : rows
          ).map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.dep}
              </TableCell>
              <TableCell style={{ width: 160 }}>{row.ret}</TableCell>
              <TableCell style={{ width: 70 }} align="center">
                {row.depID}
              </TableCell>
              <TableCell style={{ width: 160 }}>{row.depName}</TableCell>
              <TableCell style={{ width: 70 }} align="center">
                {row.retID}
              </TableCell>
              <TableCell style={{ width: 160 }}>{row.retName}</TableCell>
              <TableCell style={{ width: 160 }}>{row.dist} meters</TableCell>
              <TableCell style={{ width: 160 }}>{row.dur} seconds</TableCell>
            </TableRow>
          ))}
        </TableBody>
        <TableFooter>
          <TableRow></TableRow>
        </TableFooter>
      </Table>
    </TableContainer>
  );
}
